











/* Saber el numero de cuentas corrientes que hay en una sucursal concreta 5044*/

SELECT count(*) FROM cuentas_corrientes C ,poseer P
WHERE C.nCuenta = P.nCuenta AND C.idOficina = 5044;


/* Consultar nombre,mail y telefono de los clientes anteriores*/

SELECT C.nombre,C.email,C.telefono 
FROM clientes C,poseer P, cuentas C 
WHERE P.nCuenta = C.nCuenta AND C.tipo = 0 AND C.idOficina = 5044 AND C.dni = P.dni;

/* Consultar los ingresos realizados en un periodo de fechas concreto dado un DNI de unc liente */

CREATE OR REPLACE VIEW INGRESOSFECHA AS SELECT O.nOperacion,O.fechaHora,O.cantidad,O.tipoOp,O.descripcion O.idOficina  FROM operaciones O, clientes C, poseer P WHERE C.dni = 73130004 AND C.dni = P.dni AND O.origen = P.nCuenta;

